/*******************************************************************************
 * This program demonstrates use of the PS/2 port by displaying the last three
 * bytes of data received from the PS/2 port on the HEX displays.
 ******************************************************************************/
int main(void) {
  /* Declare volatile pointers to I/O registers (volatile means that IO load
  and store instructions will be used to access these pointer locations,
  instead of regular memory loads and stores) */
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;

  /* Read location of the pixel buffer from the pixel buffer controller */
  pixel_buffer_start = *pixel_ctrl_ptr;

  volatile int *PS2_ptr = (int *)PS2_BASE;
  int PS2_data, RVALID;
  char byte1 = 0, byte2 = 0, byte3 = 0;

  int x_position = 0;  // 0-11
  int y_position = 0;  // 0-11
  bool on_homePage = true;
  bool is_win = false;
  // // PS/2 mouse needs to be reset (must be already plugged in)
  // *(PS2_ptr) = 0xFF; // reset
  clear_screen();
  // initialize VGA view by function 1 (load homePage)
  load_homePage();

  while (1) {
    PS2_data = *(PS2_ptr);       // read the Data register in the PS/2 port
    RVALID = PS2_data & 0x8000;  // extract the RVALID field
    if (RVALID) {
      /* shift the next data byte into the display */
      byte1 = byte2;
      byte2 = byte3;
      byte3 = PS2_data & 0xFF;
      if (byte2 == -16) {
        printf("a keyPress is catched\n");
        if (byte1 == -32) {
          switch (byte3) {
            case 0x75:  // up
              if (y_position != 0) {
                redraw_sigle_pipe(x_position, y_position);
                --y_position;
                highlight_pipe(x_position, y_position);
              }
              printf("up, x:%d , y:%d\n", x_position, y_position);
              break;
            case 0x72:  // down
              if (y_position != 9) {
                redraw_sigle_pipe(x_position, y_position);
                ++y_position;
                highlight_pipe(x_position, y_position);
              }
              printf("down, x:%d , y:%d\n", x_position, y_position);
              break;

            case 0x6B:  // left
              if (x_position != 0) {
                redraw_sigle_pipe(x_position, y_position);
                --x_position;
                highlight_pipe(x_position, y_position);
              }
              printf("left, x:%d , y:%d\n", x_position, y_position);
              break;
            case 0x74:  // right
              if (x_position != 9) {
                redraw_sigle_pipe(x_position, y_position);
                ++x_position;
                highlight_pipe(x_position, y_position);
              }
              printf("right, x:%d , y:%d\n", x_position, y_position);
              break;
            default:
              // printf("byte3:%d\n", byte3);
              break;
          }
        } else {
          switch (byte3) {
            case 0x5A:
              printf("you pressed Enter\n");
              if (on_homePage) {
                on_homePage = false;
                draw_help_page();
                level_1 = true;
              } else if (level_2 && !check) {
                draw_level2();
                is_win = false;
                int rand_board_num = rand() % 2 + 1;
                for (int xi = 0; xi < 10; ++xi) {
                  for (int yi = 0; yi < 10; ++yi) {
                    curr_solution[xi][yi] = solution[rand_board_num][xi][yi];
                  }
                }
                random_block(curr_solution);
                for (int i = 0; i < 3000; ++i) {
                      printf(" %d", i);
                    }
                load_new_gameBoard();
                check = true;
              } else if (level_1 && !check) {
                // draw_level1();
                printf("On level 1\n");
                int boardNum = 0;
                for (int xi = 0; xi < 10; ++xi) {
                  for (int yi = 0; yi < 10; ++yi) {
                    curr_solution[xi][yi] = solution[boardNum][xi][yi];
                    // printf("Draw Block: %d", solution[boardNum][xi][yi]);
                  }
                  printf("\n");
                }
                random_block(curr_solution);
                // for (int i = 0; i < 2500; ++i) {
                //       printf(" %d", i);
                //     }
                load_new_gameBoard();
                printf("Game is started\n");
                check = true;
              } else if (check) {
                // call function 4: check result
                //  is_win = check_result();
                //  printf("Checking result ...\n");
                if (check_result()) {
                  if (level_1) {
                    level_1 = false;
                    level_2 = true;
                    check = false;
                    is_win = true;
                  } else if (level_2) {
                    level_2 = false;
                    is_win = true;
                  }
                  printf("\n");
                  
                  if (is_win) {
                    draw_final_result();
                    play_water_sound();
                    
                    if (!level_2) {
                      for (int i = 0; i < 600; ++i) {
                        printf(" %d", i);
                      }
                      load_restart_page();
                    }
                  }
                  x_position = 0;
                  y_position = 0;
                } else {
                  printf("Fail\n");
                }
              }
              break;
            case 0x29:
              printf("you pressed Space\n");
              // call function 3: "turn_pipe"
              block_turn(x_position, y_position);
              if (newGame[y_position][x_position] != 0) {
                play_gear_sound();
              }
              break;
            case 0x76:
              printf("you pressed Esc\n");
              // call function 1: load homePage
              load_homePage();
              on_homePage = true;
              level_1 = false;
              level_2 = false;
              check = false;
              clearArray(newGame, 10, 10);
              x_position = 0;
              y_position = 0;
              is_win = false;
              break;
            default:
              break;
          }
        }
      }
    }
  }
}

void clearArray(int gameboard[10][10], int row, int col) {
  for (int i = 0; i < row; i++) {
    for (int j = 0; j < col; j++) {
      gameboard[i][j] = 0;  // You can assign any default value here
    }
  }
}

void random_block(int array[10][10]) {
  int randomNum;
  for (int x = 0; x < 10; ++x) {
    for (int y = 0; y < 10; ++y) {
      if (array[x][y] == 0) {
        if (level_1) {
          array[x][y] = 0;
        } else if (level_2) {
          randomNum = rand() % 8;
          if (randomNum > 6) {
            newGame[x][y] = 0;
          } else {
            newGame[x][y] = randomNum;
          }
        }
      } else if (array[x][y] == 1 || array[x][y] == 2) {
        randomNum = rand() % 2 + 1;
        newGame[x][y] = randomNum;
      } else {
        randomNum = rand() % 4 + 3;
        newGame[x][y] = randomNum;
      }
    }
  }
}

void clear_screen() {
  for (int x = 0; x < x_max; ++x) {
    for (int y = 0; y < y_max; ++y) {
      plot_pixel(x, y, 0x0);
    }
  }
}

void draw_background() {
  for (int x = 0; x < x_max; ++x) {
    for (int y = 0; y < y_max; ++y) {
      plot_pixel(x, y, 36639);
    }
  }
}

void draw_background_pipes() {
  int start_x = 60;
  int start_y = 0;
  int end_x = 260;
  int end_y = 200;
  for (int row = start_x; row < start_x + 20; ++row) {
    for (int col = start_y; col < start_y + 20; ++col) {
      plot_pixel(row, col, start_pipe[col - start_y][row - start_x]);
    }
  }

  for (int row = end_x; row < end_x + 60; row++) {
    for (int col = end_y; col < end_y + 40; col++) {
      plot_pixel(row, col, end_dry_60x40[col - end_y][row - end_x]);
    }
  }
}

void play_water_sound() {
  
  int n = 2;
  audiop->control = 0x8;  // clear the output FIFOs
  audiop->control = 0x0;  // resume input conversion

  while (n > 0) {
    int t = 0;
    while (t != 30208) {
      while (audiop->wsrc == 0);
      audiop->ldata = water_samples[t];  // store to the left output fifo
      audiop->rdata = water_samples[t];  // store to the right output
      t++;
    }
    n--;
  }
}

void play_gear_sound() {
  //struct audio_t *const audiop = ((struct audio_t *)AUDIO_BASE);
  int t = 0;
  audiop->control = 0x8;  // clear the output FIFOs
  audiop->control = 0x0;  // resume input conversion
  while (t != 4287) {
    while (audiop->wsrc == 0);
    audiop->ldata = gear_sound_samples[t];  // store to the left output fifo
    audiop->rdata = gear_sound_samples[t];  // store to the right output
    t++;
  }
}

void block_turn(int x_location, int y_location) {
  int pictureNum = newGame[y_location][x_location];
  int drawNum = pictureNum;
  printf("DrawNum Before: %d\n", pictureNum);
  switch (pictureNum) {
    case 0:
      drawNum = 0;
      break;
    case 1:
      drawNum = 2;
      break;
    case 2:
      drawNum = 1;
      break;
    case 3:
      drawNum = 4;
      break;
    case 4:
      drawNum = 5;
      break;
    case 5:
      drawNum = 6;
      break;
    case 6:
      drawNum = 3;
      break;
    default:
      printf("Enrror: picture number not found\n");
      break;
  }
  newGame[y_location][x_location] = drawNum;
  printf(" DrawNum After: %d\n", drawNum);
  draw_highlight_block(drawNum, x_location * 20 + 60, y_location * 20 + 20);
}

void draw_block(int num, int x_start, int y_start) {
  for (int x = x_start; x < x_start + 20; ++x) {
    for (int y = y_start; y < y_start + 20; ++y) {
      if (num == 0) plot_pixel(x, y, empty[y - y_start][x - x_start]);
      if (num == 1) plot_pixel(x, y, pipe1[y - y_start][x - x_start]);
      if (num == 2) plot_pixel(x, y, pipe2[y - y_start][x - x_start]);
      if (num == 3) plot_pixel(x, y, pipe3[y - y_start][x - x_start]);
      if (num == 4) plot_pixel(x, y, pipe4[y - y_start][x - x_start]);
      if (num == 5) plot_pixel(x, y, pipe5[y - y_start][x - x_start]);
      if (num == 6) plot_pixel(x, y, pipe6[y - y_start][x - x_start]);
    }
  }
}

void load_new_gameBoard() {
  int x_start = 60;
  int y_start = 20;
  draw_background();
  draw_background_pipes();
  for (int num1 = 0; num1 < 10; num1++) {
    x_start = 60;
    for (int num2 = 0; num2 < 10; num2++) {
      // draw_block(solution[num1][num2], x_start, y_start);
      draw_block(newGame[num1][num2], x_start, y_start);
      x_start = x_start + 20;
    }
    y_start = y_start + 20;
  }
  x_start = 60;
  y_start = 20;
  draw_highlight_block(newGame[0][0], x_start, y_start);
}

void plot_pixel(int x, int y, short int color) {
  volatile short int *one_pixel_address;
  one_pixel_address = pixel_buffer_start + (y << 10) + (x << 1);
  // if(x == 0)
  // printf("address: %d\n ", one_pixel_address);
  *one_pixel_address = color;
}

