bool check_result() {
  short int current[5];
  int prev_x, prev_y;
  int x = 0;
  int y = 0;
  int pipe_num;
  bool match = true;
  pipe_num = newGame[y][x];
  for (int i = 0; i < 5; ++i) {
    current[i] = pipe_block[pipe_num][i];
  }
  match = current[1];

  if (match) {
    if (current[2]) {
      prev_x = x;
      prev_y = y;
      ++y;
    } else if (current[3]) {
      match = false;
    } else {  // current[4] = 1
      prev_x = x;
      prev_y = y;
      ++x;
    }
  } else {
    // printf("1:%d, %d\n",x, y);
    return match;
  }
  while (match) {
    for (int i = 0; i < 100; ++i) {
      printf(" %d", i);
    }
    printf("\n");
    draw_filled_pipes(current[0], prev_x, prev_y);
    pipe_num = newGame[y][x];
    for (int i = 0; i < 5; ++i) {
      current[i] = pipe_block[pipe_num][i];
    }
    if (x == 9 && y == 9) {
      match = current[4];
      if (match) draw_filled_pipes(current[0], x, y);
      return match;
    }
    if ((y - prev_y) > 0) {
      match = current[1];
      if (match) {
        if (current[2]) {
          prev_x = x;
          prev_y = y;
          ++y;
        } else if (current[3]) {
          prev_x = x;
          prev_y = y;
          --x;
        } else {  // current.right = 1
          prev_x = x;
          prev_y = y;
          ++x;
        }
      }
    } else if ((x - prev_x) > 0) {
      match = current[3];
      if (current[2]) {
        prev_x = x;
        prev_y = y;
        ++y;
      } else if (current[1]) {
        prev_x = x;
        prev_y = y;
        --y;
      } else {  // current.right = 1
        prev_x = x;
        prev_y = y;
        ++x;
      }
    } else if ((prev_y - y) > 0) {
      match = current[2];
      if (current[3]) {
        prev_x = x;
        prev_y = y;
        --x;
      } else if (current[1]) {
        prev_x = x;
        prev_y = y;
        --y;
      } else {  // current.right = 1
        prev_x = x;
        prev_y = y;
        ++x;
      }
    } else if ((prev_x - x) > 0) {
      match = current[4];
      if (current[2]) {
        prev_x = x;
        prev_y = y;
        ++y;
      } else if (current[1]) {
        prev_x = x;
        prev_y = y;
        --y;
      } else {  // current.left = 1
        prev_x = x;
        prev_y = y;
        --x;
      }

    } else {
      match = false;
    }
    match = match && (x != -1) && (y != -1);
    match = match && (x != 10) && (y != 10);
  }
  return match;
}

